import { Component } from "react";

class ProgressComponent extends Component {
    constructor(props) {
        super(props);

        this.state = {
            day: 1,
            description: "Do 25 pushups"
        }
    }

    render() {
        return <div>Progress Component for Day - {this.props.params.day}</div>;
    }
}

export default ProgressComponent;
